function LoginPage() {
    return (
        <div className="App">
            <header className="App-header">
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Login Page
                </a>
            </header>
        </div>
    );
}

export default LoginPage;
